frappe.web_form.after_load = () => {
    if (window.location.pathname.endsWith("/new") && frappe.session.user) {
        let current_path = window.location.href;
        window.location.href = current_path.replace("/new", "/" + frappe.session.user);
    }
}

setTimeout(() => {
    const grid = frappe.web_form.fields_dict.metrics_update?.grid;
    if (!grid) {
        console.error("❌ Child table grid not found");
        return;
    }

    // Attach blur event listener on height and weight inputs
    grid.wrapper.on('blur', 'input[data-fieldname="current_height"], input[data-fieldname="current_weight"]', function () {
        const $row = $(this).closest('.grid-row');
        const row_name = $row.attr("data-name");

        if (!row_name) {
            console.warn("⚠️ Could not get row name");
            return;
        }

        const rows = frappe.web_form.get_value("metrics_update") || [];
        const row = rows.find(r => r.name === row_name);

        if (!row) {
            console.warn("⚠️ Could not find row with name:", row_name);
            return;
        }

        let height = parseFloat(row.current_height);
        let weight = parseFloat(row.current_weight);

        if (!height || !weight || height === 0) {
            console.log("⚠️ Missing or invalid inputs for BMI calculation");
            // Optionally clear BMI if inputs are invalid
            row.bmi = "";
        } else {
            // Height is assumed in cm, convert to meters
            let height_m = height / 100;
            let bmi = weight / (height_m * height_m);
            row.bmi = bmi.toFixed(2);
            console.log(`✅ Calculated BMI for row ${row_name}: ${row.bmi}`);
        }

        // Update the whole child table back to the form
        frappe.web_form.set_value("metrics_update", rows).then(() => {
            console.log("✅ BMI updated in the form");
        });
    });

    console.log("✅ Listeners for current_height and current_weight attached");
}, 500);

// ✅ Updated Gym Subscription Web Form Client Script

frappe.web_form.after_load = () => {
    console.log("✅ Gym Subscription Web Form loaded");

    // Initial calculations and UI setup
    update_end_date();
    update_final_price();
    update_locker_description();
    fetch_and_show_available_lockers();
    calculate_remaining_days();

    // Event listeners
    frappe.web_form.on('start_date', () => {
        update_end_date();
        calculate_remaining_days();
    });
    frappe.web_form.on('end_date', calculate_remaining_days);
    frappe.web_form.on('plan_type', () => {
        update_end_date();
        update_final_price();
        calculate_remaining_days();
    });
    frappe.web_form.on('locker', () => {
        update_final_price();
        update_locker_description();
    });
};

function update_end_date() {
    let start_date = frappe.web_form.get_value('start_date');
    let plan_type = frappe.web_form.get_value('plan_type');

    if (!start_date || !plan_type) return;

    let months = 0;

    if (plan_type.includes("1 Month")) {
        months = 1;
    } else if (plan_type.includes("3 Months")) {
        months = 3;
    } else if (plan_type.includes("1 Year")) {
        months = 12;
    }

    if (months > 0) {
        const end_date = frappe.datetime.add_months(start_date, months);
        frappe.web_form.set_value('end_date', frappe.datetime.obj_to_str(end_date));
        console.log("🗕 End Date Updated:", end_date);
    }
}

function update_final_price() {
    let plan_type = frappe.web_form.get_value('plan_type');
    let locker = frappe.web_form.get_value('locker');

    if (!plan_type) return;

    let price_match = plan_type.match(/₹(\d+)/);
    let base_price = price_match ? parseInt(price_match[1]) : 0;
    let locker_count = parseInt(locker) || 0;

    frappe.call({
        method: "frappe.client.get",
        args: {doctype: "Gym Settings", name: "Gym Settings"},
        callback: function(r) {
            let locker_price = 0;
            if (r.message && r.message.locker_price_1m) {
                locker_price = r.message.locker_price_1m * locker_count;
            }
            let total_price = base_price + locker_price;
            frappe.web_form.set_value('final_price', total_price);
            console.log(`💸 Final Price Updated: ₹${total_price}`);
        }
    });
}

function update_locker_description() {
    let locker = frappe.web_form.get_value('locker');
    let locker_count = parseInt(locker) || 0;

    if (locker_count === 0) {
        frappe.web_form.fields_dict.locker.df.description = "";
    } else {
        let locker_numbers = [];
        for (let i = 0; i < locker_count; i++) {
            let rand_num = Math.floor(100 + Math.random() * 900);
            locker_numbers.push(`L${rand_num}`);
        }
        frappe.web_form.fields_dict.locker.df.description = "Assigned Lockers: " + locker_numbers.join(", ");
    }
    frappe.web_form.fields_dict.locker.refresh();
}

function fetch_and_show_available_lockers() {
    frappe.call({
        method: "frappe.client.get",
        args: {doctype: "Gym Settings", name: "Gym Settings"},
        callback: function(r) {
            if (r.message) {
                let settings = r.message;
                let available = settings.total_lockers - settings.used_lockers;
                console.log(`Available lockers: ${available}`);
                if (frappe.web_form.fields_dict.available_lockers) {
                    frappe.web_form.set_value("available_lockers", available);
                }
            }
        }
    });
}

// ✨ Trainer Filter Based on Specialization
frappe.web_form.on('specialization', () => {
    const specialization = frappe.web_form.get_value("specialization");
    console.log("🔄 Specialization Selected:", specialization);

    if (!specialization) {
        console.warn("⚠️ No specialization selected");
        return;
    }

    frappe.call({
        method: "gym_management.jim.api.get_filtered_trainers",
        args: {
            doctype: "Gym Trainer",
            txt: "",
            searchfield: "full_name",
            start: 0,
            page_len: 20,
            filters: JSON.stringify({ specialization })
        },
        callback: function (r) {
            console.log("✅ API Response:", r.message);

            const trainerSelect = document.querySelector('select[data-fieldname="trainer"]');
            if (!trainerSelect) {
                console.warn("Trainer select field not found");
                return;
            }

            trainerSelect.innerHTML = "";

            if (r.message && r.message.length > 0) {
                r.message.forEach(opt => {
                    const optionElem = document.createElement("option");
                    optionElem.value = opt.value || opt.name || opt.label || "";
                    optionElem.textContent = opt.label || opt.value || opt.name || "";
                    trainerSelect.appendChild(optionElem);
                });
            } else {
                const optionElem = document.createElement("option");
                optionElem.value = "";
                optionElem.textContent = "No trainers available";
                trainerSelect.appendChild(optionElem);
            }

            trainerSelect.dispatchEvent(new Event('change'));
            console.log("✅ Trainer options updated dynamically");
        },
        error: function (err) {
            console.error("❌ API Error:", err);
        }
    });
});

// 📅 Dynamic Remaining Days in End Date Description
function calculate_remaining_days() {
    let start = frappe.web_form.get_value('start_date');
    let end = frappe.web_form.get_value('end_date');

    if (!start || !end) return;

    const today = frappe.datetime.get_today();

    if (frappe.datetime.obj_to_str(end) >= today) {
        const startDate = frappe.datetime.str_to_obj(start);
        const endDate = frappe.datetime.str_to_obj(end);
        const diffMs = endDate - new Date();
        const daysLeft = Math.floor(diffMs / (1000 * 60 * 60 * 24));

        if (daysLeft >= 0 && frappe.web_form.fields_dict.end_date) {
            frappe.web_form.fields_dict.end_date.df.description = `${daysLeft} day(s) remaining`;
            frappe.web_form.fields_dict.end_date.refresh();
        }
    }
}

