frappe.web_form.after_load = () => {
    console.log("Web Form loaded");

    // 1. Set Email field (Data)
    frappe.web_form.set_value("email", email).then(() => {
        console.log("Email field set to:", email);
    });

    // 2. Wait for grid to load
    setTimeout(() => {
        const grid = frappe.web_form.fields_dict.table_ctkk?.grid;
        if (!grid) {
            console.error("Child table grid not found");
            return;
        }

        console.log("Grid found, attaching listeners");

        grid.wrapper.on(
            'input',
            'input[data-fieldname="current_height"], input[data-fieldname="current_weight"]',
            function () {
                const $row = $(this).closest('.grid-row');
                const row_name = $row.attr("data-name");

                const heightVal = $row.find('input[data-fieldname="current_height"]').val();
                const weightVal = $row.find('input[data-fieldname="current_weight"]').val();
                const bmiInput = $row.find('input[data-fieldname="bmi"]');

                const height = parseFloat(heightVal);
                const weight = parseFloat(weightVal);

                if (!height || !weight || height <= 0) {
                    if (bmiInput) bmiInput.val('');
                    return;
                }

                const bmi = (weight * 10000) / (height * height);
                const bmiVal = bmi.toFixed(2);

                if (bmiInput) {
                    bmiInput.val(bmiVal).trigger('input');
                    console.log(`Calculated BMI: ${bmiVal}`);
                }

                const rows = frappe.web_form.get_value("table_ctkk") || [];
                const row = rows.find(r => r.name === row_name);
                if (row) {
                    row.bmi = bmiVal;
                    frappe.web_form.set_value("table_ctkk", rows);
                }
            }
        );
    }, 800);
};
